import React from "react";

function Assignment() {
  return (
    <div>
      <h5 className="title-left">Assignment 1</h5>
      <p className="title-right">
        Submitted: <span className="marks">15/20</span>
      </p>
      <p style={{color: " #40c8e0"}}>Maths</p>
      <p >Rational Numbers assignment, very important for your next exam...
      Rational numbers are a subset of Irrational numbers, and are a superset of natural, whole, and integral numbers.
      </p>
    </div>
  );
}
export default Assignment;
